long long countInterestingSubarrays(int* nums, int numsSize, int modulo, int k){
    long long count = 0;
    for (int start = 0; start < numsSize; ++start) {
        int cnt = 0;
        for (int end = start; end < numsSize; ++end) {
            if (nums[end] % modulo == k) cnt++;
            if (cnt % modulo == k) count++;
        }
    }
    return count;
}
